import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person'

class App extends Component {
  state = {
    persons: [
      { name: 'Jeff', age: 45 },
      { name: 'Kathleen', age: 45 },
      { name: 'Anastasia', age: 45 }
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>My New React App</h1>
        <button>Switch Name</button>
        <Person name={this.state.persons [0].name} />
        <Person name="Kathleen" age="45">Is Cool!</Person>
        <Person name="Anastasia" age="10">Is the Best...ist Daughter!!!!</Person>


      </div>
    );
  }
}

export default App;
